// Lê data.purchase.origin.sck e gera os campos UTM no item de saída

const UTM_KEYS = ['utm_source', 'utm_medium', 'utm_campaign', 'utm_term', 'utm_content'];

return items.map(({ json, binary }) => {
  // Pega o sck (garante string) e faz URL-decode
  const rawSck = (json?.data?.purchase?.origin?.sck ?? '') + '';
  const decoded = decodeURIComponent(rawSck).trim();

  // Se vier algo no formato "...?x=1&sck=foo|bar", tenta extrair "sck=" da query também
  let sckValue = decoded;
  if (decoded.includes('sck=')) {
    try {
      const q = decoded.split('?')[1] || decoded;
      const pairs = q.split('&');
      const found = pairs.find(p => p.startsWith('sck='));
      if (found) sckValue = decodeURIComponent(found.split('=')[1] || '');
    } catch (_) {}
  }

  // Quebra pelos pipes e normaliza
  const parts = sckValue.split('|').map(s => s?.trim() ?? '');

  // Monta objeto UTM respeitando a ordem pedida
  const utms = {};
  UTM_KEYS.forEach((key, idx) => {
    utms[key] = parts[idx] ?? '';
  });

  // Retorna o item com os campos adicionados
  return {
    json: {
      ...json,
      // adiciona também como campos "flat" para facilitar mapeamentos
      ...utms,
      // e um bloco agrupado
      utms,
      // ecoa o sck lido (útil para debug)
      _sck_raw: rawSck,
      _sck_decoded: sckValue,
    },
    binary,
  };
});

